import{_ as e,o as r,c as t,O as o}from"./chunks/framework.9482e208.js";const u=JSON.parse(`{"title":"§ 64.2-631 Effect of transfer on death deed during transferor's life.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/64.2-631.md","filePath":"vacode/64.2-631.md"}`),a={name:"vacode/64.2-631.md"},i=o('<h1 id="§-64-2-631-effect-of-transfer-on-death-deed-during-transferor-s-life" tabindex="-1">§ 64.2-631 Effect of transfer on death deed during transferor&#39;s life. <a class="header-anchor" href="#§-64-2-631-effect-of-transfer-on-death-deed-during-transferor-s-life" aria-label="Permalink to &quot;§ 64.2-631 Effect of transfer on death deed during transferor&#39;s life.&quot;">​</a></h1><p>During a transferor&#39;s life, a transfer on death deed does not:</p><ol><li><p>Affect an interest or right of the transferor or any other owner, including the right to transfer or encumber the property;</p></li><li><p>Affect an interest or right of a transferee, even if the transferee has actual or constructive notice of the deed;</p></li><li><p>Affect an interest or right of a secured or unsecured creditor or future creditor of the transferor, even if the creditor has actual or constructive notice of the deed;</p></li><li><p>Affect the transferor&#39;s or designated beneficiary&#39;s eligibility for any form of public assistance;</p></li><li><p>Create a legal or equitable interest in favor of the designated beneficiary; or</p></li><li><p>Subject the property to claims or process of a creditor of the designated beneficiary.</p></li></ol><p>2013, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0390" target="_blank" rel="noreferrer">390</a>.</p>',4),n=[i];function f(s,d,c,l,h,p){return r(),t("div",null,n)}const g=e(a,[["render",f]]);export{u as __pageData,g as default};
